    #function for rotation
    def handleClockwiseButton(self):
        self.group = QGraphicsItemGroup()
        self.group = self.scene.createItemGroup(self.scene.selectedItems())

        offset = QtCore.QPointF()
        offset = self.group.sceneBoundingRect().center()
        self.transform = QtGui.QTransform()
        self.transform.translate(offset.x(),offset.y())
        self.transform.rotate(45)
        self.transform.translate(-offset.x(),-offset.y())
        self.group.setTransform(self.transform)

        self.scene.destroyItemGroup(self.group)
        self.scene.update()

    #function for rotation
    def handleCClockwiseButton(self):
        self.group = QGraphicsItemGroup()
        self.group = self.scene.createItemGroup(self.scene.selectedItems())

        offset = QtCore.QPointF()
        offset = self.group.sceneBoundingRect().center()
        self.transform = QtGui.QTransform()
        self.transform.translate(offset.x(),offset.y())
        self.transform.rotate(-45)
        self.transform.translate(-offset.x(),-offset.y())
        self.group.setTransform(self.transform)

        self.scene.destroyItemGroup(self.group)
        self.scene.update()

