    #function for delete selected-item
    def deleteItem(self):
        if not self.scene.selectedItems():
           QMessageBox.information(self,"Delete Symbol!","Please select any symbol to delete!", QMessageBox.Ok,0)
        else:
           ret = QMessageBox.warning(self, "SignWriting Symbols",
                    "Are you sure you want to permanently delete Selected 'MSW Symbols'?",
                    QMessageBox.Ok |
                    QMessageBox.Cancel)
           if ret == QMessageBox.Ok:
               for item in self.scene.selectedItems():
                   self.scene.removeItem(item)
           elif ret == QMessageBox.Cancel:
               return False
           

    #function for bringToFront action
    def bringToFront(self):
        if not self.scene.selectedItems():
            return
  
        selectedItem = self.scene.selectedItems()[0]
        overlapItems = selectedItem.collidingItems()
  
        zValue = 0
        for item in overlapItems:
            if (item.zValue() >= zValue):
                zValue = item.zValue() + 0.1
        selectedItem.setZValue(zValue)
  
    #function for sendToBack action
    def sendToBack(self):
        if not self.scene.selectedItems():
            return
  
        selectedItem = self.scene.selectedItems()[0]
        overlapItems = selectedItem.collidingItems()
  
        zValue = 0
        for item in overlapItems:
            if (item.zValue() <= zValue):
                zValue = item.zValue() - 0.1
        selectedItem.setZValue(zValue)


